import React, { useState } from 'react';
import styled from 'styled-components';

const PortfolioSection = styled.section`
  padding: 100px 0;
  background-color: ${props => props.theme.colors.accent};
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const Title = styled.h2`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 2.5rem;
  text-align: center;
  margin-bottom: 3rem;
  color: ${props => props.theme.colors.text};
`;

const FilterContainer = styled.div`
  display: flex;
  justify-content: center;
  gap: 1rem;
  margin-bottom: 3rem;
  flex-wrap: wrap;
`;

const FilterButton = styled.button`
  background: none;
  border: 2px solid ${props => props.active ? props.theme.colors.primary : 'transparent'};
  padding: 0.5rem 1.5rem;
  font-family: ${props => props.theme.fonts.secondary};
  font-size: 1rem;
  color: ${props => props.active ? props.theme.colors.primary : props.theme.colors.text};
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    color: ${props => props.theme.colors.primary};
    border-color: ${props => props.theme.colors.primary};
  }
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 2rem;
`;

const ProjectCard = styled.div`
  position: relative;
  overflow: hidden;
  border-radius: 8px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);

  &:hover {
    .overlay {
      opacity: 1;
    }
  }
`;

const ProjectImage = styled.img`
  width: 100%;
  height: 300px;
  object-fit: cover;
  transition: transform 0.3s ease;
`;

const ProjectOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: rgba(0, 0, 0, 0.7);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  opacity: 0;
  transition: opacity 0.3s ease;
  padding: 2rem;
  color: white;
  text-align: center;
`;

const ProjectTitle = styled.h3`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1.5rem;
  margin-bottom: 1rem;
`;

const ProjectDescription = styled.p`
  font-size: 1rem;
  line-height: 1.6;
`;

const Portfolio = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: "Appartement Haussmannien",
      description: "Rénovation complète d'un appartement de 120m² dans le style haussmannien moderne",
      category: "residential",
      image: "/images/project1.jpg"
    },
    {
      id: 2,
      title: "Bureau Open Space",
      description: "Aménagement d'un espace de travail collaboratif de 300m²",
      category: "commercial",
      image: "/images/project2.jpg"
    },
    {
      id: 3,
      title: "Restaurant Gastronomique",
      description: "Design intérieur d'un restaurant étoilé au cœur de Paris",
      category: "commercial",
      image: "/images/project3.jpg"
    },
    // Ajoutez plus de projets ici
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  return (
    <PortfolioSection id="portfolio">
      <Container>
        <Title>Nos Réalisations</Title>
        <FilterContainer>
          <FilterButton 
            active={activeFilter === 'all'} 
            onClick={() => setActiveFilter('all')}
          >
            Tous
          </FilterButton>
          <FilterButton 
            active={activeFilter === 'residential'} 
            onClick={() => setActiveFilter('residential')}
          >
            Résidentiel
          </FilterButton>
          <FilterButton 
            active={activeFilter === 'commercial'} 
            onClick={() => setActiveFilter('commercial')}
          >
            Commercial
          </FilterButton>
        </FilterContainer>
        <Grid>
          {filteredProjects.map(project => (
            <ProjectCard key={project.id}>
              <ProjectImage src={project.image} alt={project.title} />
              <ProjectOverlay className="overlay">
                <ProjectTitle>{project.title}</ProjectTitle>
                <ProjectDescription>{project.description}</ProjectDescription>
              </ProjectOverlay>
            </ProjectCard>
          ))}
        </Grid>
      </Container>
    </PortfolioSection>
  );
};

export default Portfolio;
